  \"2015-05-06T23:19:14.505932\",\n\t\"name\": \"shuttle-sbuv-ssbuv-ozone-profile-ozone-total-column-aerosol-index-and-uv-reflectivity-leve\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Shuttle Solar Backscatter Ultraviolet
  (SSBUV) Level-2 Ozone data are available for eight space shuttle missions flown
  between 1989 and 1996. SSBUV, a successor to the SBUV flown on the Nimbus-7 satellite,
  is nearly identical to the SBUV/2 instruments flying on the NOAA satellites. Data
  are available in the ASCII AMES text format. Ozone profiles of the uppoer atmosphere
  and total column ozone values are available for the following time periods:nn Flight
  #1:  1989 October 19, 20, 21.n Flight #2:  1990 October 7, 8, 9.n Flight #3:  1991
  August 3, 4, 5, 6.n Flight #4:  1992 March 29, 31.n Flight #5:  1993 April 9, 11,
  13, 15, 16.n Flight #6:  1994 March 14, 15, 17.n Flight #7:  1994 November 5, 7,
  10, 13.n Flight #8:  1996 January 12, 16, 18.nnSSBUV measures spectral ultraviolet
  radiances backscattered by the earth's atmosphere. For the ozone measurements the
  instrument steps over wavelengths between 252.2 and 339.99 nm while viewing the
  earth in the nadir position (50 km x 50 km footprint at nadir) at 19 pressure levels
  between 0.3 mb and 100 mb.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
